import { 
    getFirestore, collection, getDocs, query
} from "https://www.gstatic.com/firebasejs/9.15.0/firebase-firestore.js";

// --- PEGA AQUÍ EL CÓDIGO DE TU LOGO ---
// Reemplaza el contenido de esta variable con el texto larguísimo que copiaste en el paso 2.
// Asegúrate de que empiece con 'data:image/png;base64,' y esté entre comillas simples.
const logoBase64 = 'data:image/png;base64,';


export function setupPrecios(app) {
    const db = getFirestore(app);
    const recetasCollection = collection(db, 'recetas');
    const materiasPrimasCollection = collection(db, 'materiasPrimas');

    const container = document.getElementById('lista-precios-container');
    const inputMayorista = document.getElementById('porcentaje-mayorista');
    const inputMinorista = document.getElementById('porcentaje-minorista');
    const btnPdfCosto = document.getElementById('btn-pdf-costo');
    const btnPdfMayorista = document.getElementById('btn-pdf-mayorista');
    const btnPdfMinorista = document.getElementById('btn-pdf-minorista');

    let recetasConCosto = [];

    const init = async () => {
        try {
            const [snapshotRecetas, snapshotMateriasPrimas] = await Promise.all([
                getDocs(query(recetasCollection)),
                getDocs(query(materiasPrimasCollection))
            ]);
            const todasLasRecetas = snapshotRecetas.docs.map(doc => ({ id: doc.id, ...doc.data() }));
            const materiasPrimasMap = new Map(snapshotMateriasPrimas.docs.map(doc => [doc.id, doc.data()]));
            recetasConCosto = todasLasRecetas.map(receta => ({
                ...receta,
                costoCalculado: calcularCostoUnitarioReceta(receta, materiasPrimasMap)
            }));
            renderizarListaPrecios(recetasConCosto);
            setupEventListeners();
        } catch (error) {
            console.error("Error al cargar la lista de precios:", error);
            container.innerHTML = '<p style="color:var(--danger-color);">No se pudieron calcular los precios.</p>';
        }
    };

    const calcularCostoUnitarioReceta = (receta, materiasPrimasMap) => {
        let costoTotal = 0;
        if (!receta.ingredientes) return 0;
        receta.ingredientes.forEach(ing => {
            const mp = materiasPrimasMap.get(ing.idMateriaPrima);
            if (mp && mp.lotes && mp.lotes.length > 0) {
                const ultimoLote = [...mp.lotes].sort((a, b) => b.fechaCompra.seconds - a.fechaCompra.seconds)[0];
                costoTotal += (ultimoLote.costoUnitario || 0) * ing.cantidad;
            }
        });
        return receta.rendimiento > 0 ? costoTotal / receta.rendimiento : costoTotal;
    };

    const renderizarListaPrecios = (recetas) => {
        container.innerHTML = '';
        if (recetas.length === 0) {
            container.innerHTML = '<p>No tienes recetas creadas.</p>';
            return;
        }
        const porCategoria = {};
        recetas.forEach(r => {
            const cat = r.categoria || 'Sin Categoría';
            if (!porCategoria[cat]) porCategoria[cat] = [];
            porCategoria[cat].push(r);
        });
        Object.keys(porCategoria).sort().forEach(cat => {
            container.innerHTML += `<h3 class="card__subtitle">${cat}</h3>`;
            const lista = document.createElement('ul');
            lista.className = 'lista-sencilla';
            porCategoria[cat].sort((a, b) => a.nombreTorta.localeCompare(b.nombreTorta)).forEach(r => {
                lista.innerHTML += `<li><span>${r.nombreTorta} (x unidad)</span><strong style="color: var(--primary-color); font-size: 1.1rem;">$${r.costoCalculado.toLocaleString('es-AR', { minimumFractionDigits: 2, maximumFractionDigits: 2 })}</strong></li>`;
            });
            container.appendChild(lista);
        });
    };

    const generarPDF = (titulo, porcentajeGanancia) => {
        if (recetasConCosto.length === 0) {
            alert("No hay recetas para generar la lista.");
            return;
        }
        const { jsPDF } = window.jspdf;
        const doc = new jsPDF();

        // Función interna para crear el contenido del PDF
        const crearContenido = () => {
            doc.setFontSize(22);
            doc.text(titulo, 105, 20, null, null, 'center');
            doc.setFontSize(12);
            doc.text(`Generado el: ${new Date().toLocaleDateString('es-AR')}`, 105, 30, null, null, 'center');

            const head = [['Categoría', 'Producto', 'Precio por Unidad']];
            const body = [];
            const porCategoria = {};
            recetasConCosto.forEach(r => {
                const cat = r.categoria || 'Sin Categoría';
                if (!porCategoria[cat]) porCategoria[cat] = [];
                porCategoria[cat].push(r);
            });
            Object.keys(porCategoria).sort().forEach(cat => {
                porCategoria[cat].sort((a,b) => a.nombreTorta.localeCompare(b.nombreTorta)).forEach(r => {
                    const precioFinal = r.costoCalculado * (1 + (porcentajeGanancia / 100));
                    body.push([cat, r.nombreTorta, `$${precioFinal.toLocaleString('es-AR', { minimumFractionDigits: 2, maximumFractionDigits: 2 })}`]);
                });
            });

            doc.autoTable({
                head: head,
                body: body,
                startY: 40,
                theme: 'grid',
                headStyles: { fillColor: [255, 150, 197] }
            });

            const nombreArchivo = `${titulo.replace(/ /g, '_')}.pdf`;
            doc.save(nombreArchivo);
        };

        // Añadir el logo como marca de agua
        if (logoBase64 && logoBase64.startsWith('data:image')) {
            doc.globalAlpha = 0.1; // Opacidad baja
            doc.addImage(logoBase64, 'PNG', 50, 100, 110, 110, 'watermark', 'NONE');
            doc.globalAlpha = 1.0; // Restaurar opacidad
        }
        
        crearContenido();
    };

    const setupEventListeners = () => {
        btnPdfCosto.addEventListener('click', () => generarPDF('Lista de Precios de Costo', 0));
        btnPdfMayorista.addEventListener('click', () => {
            const porcentaje = parseFloat(inputMayorista.value) || 0;
            generarPDF('Lista de Precios Mayorista', porcentaje);
        });
        btnPdfMinorista.addEventListener('click', () => {
            const porcentaje = parseFloat(inputMinorista.value) || 0;
            generarPDF('Lista de Precios Minorista', porcentaje);
        });
    };

    init();
}
